import React, { Component } from 'react'

export class Card extends Component {
    render() {
        const style = {
            height: "50%",
            margin: "1em"
        }
        return (
            <div className="container container-fluid">
                <div class="card">
                  <img className="card-body" style={style} src="https://vignette.wikia.nocookie.net/villains/images/a/a3/GollumAUJTextlessPoster.jpeg/revision/latest?cb=20151020122542" alt="Gollum"/>
                </div>
            </div>
        )
    }
}

export default Card;
